import React from 'react';
import './Header.css';

function Header() {
  return (
    <header>
      <nav>
        <div className="logo-container">
          <img src="imglogo.png" alt="Логотип" className="logo" />
        </div>
        <button className="burger-menu">&#9776;</button>
        <ul>
          <li><a href="#goals">Мої цілі</a></li>
          <li><a href="#progress">Прогрес</a></li>
          <li><a href="#community">Спільнота</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
